import React from 'react';
import { NavLink } from 'react-router-dom'
const Naviger = () => {
    return (
        <div>
            <ul>
                <NavLink to="/">
                    < li > Accueil</li>
                </NavLink>

                <NavLink to="about">
                    < li > A propos</li>
                </NavLink >
                <NavLink to="calculatrice">
                    < li >  Calculatrice</li>
                </NavLink >
            </ul>
        </div >
    );
};

export default Naviger;
